import React from "react";

function Login(){
    return(
        <Box sx={{
            display: "grid",
            gap: "0",
            width:"50%",
            margin: "auto",
            gridTemplateAreas: `"main sidebar"`,
            gridTemplateColumns: "minmax(0,2fr) minmax(0,1fr)"                 
           }}>
                <Box sx={{ gridArea: 'main' , border:1 , height:"500px"}}>Story</Box>
                <Box sx={{ gridArea: 'sidebar', border:1 ,mt: 10 ,maxHeight:"300px"}}> Box</Box>
        </Box>

    );
}

export default Login;
